INSERT INTO `wp_posts` VALUES (2,2,'2019-07-21 18:46:31','2019-07-21 18:46:31','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://handc.helloandco.co/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','publish','closed','open','','sample-page','','','2019-07-21 18:46:31','2019-07-21 18:46:31','',0,'http://handc.helloandco.co/?page_id=2',0,'page','',0),(4,2,'2019-07-21 20:30:03','2019-07-21 20:30:03','','woocommerce-placeholder','','inherit','open','closed','','woocommerce-placeholder-2','','','2019-07-21 20:30:03','2019-07-21 20:30:03','',0,'http://fifthinning.wpengine.com/wp-content/uploads/2019/07/woocommerce-placeholder.png',0,'attachment','image/png',0),(6,2,'2020-02-01 18:11:53','2020-02-01 18:11:53','','woocommerce-placeholder','','inherit','open','closed','','woocommerce-placeholder','','','2020-02-01 18