head.</li>\n 	<li>Fry, we have a crate to deliver.</li>\n</ol>\n<h3>Hello, little man. I will destroy you!</h3>\nYes, I saw. You were doing well, until everyone died. Check it out, y\'all. Everyone who was invited is here. But I know you in the future. I cleaned your poop. I\'m sure those windmills will keep them cool.\n<ul>\n 	<li>No! The cat shelter\'s on to me.</li>\n 	<li>And remember, don\'t do anything that affects anything, unless it turns out you were supposed to, in which case, for the love of God, don\'t not do it!</li>\n 	<li>I don\'t \'need\' to drink. I can quit anytime I want!</li>\n</ul>\nWho am I making this out to? What\'s with you kids? Every other day it\'s food, food, food. Alright, I\'ll get you some stupid food. Who am I making this out to? I\'m sure those windmills will keep them cool.\n\nThen throw her in the laundry room, which will hereafter be referred to as \"the brig\". Kids have names? Come, Comrade Bender! We must take to the streets! Shut up and get to the point! Have you ever tried just turning off the TV, sitting down with your children, and hitting them?\n<blockquote>Who are those horrible orange men? Son, as your lawyer, I declare y\'all are in a 12-piece bucket o\' trouble. But I done struck you a deal: Five hours of community service cleanin\' up that ol\' mess you caused.</blockquote>\n[gallery link=\"none\" columns=\"2\" size=\"full\" ids=\"923,922\"]\n\nI\'ll tell them you went down prying the wedding ring off his cold, dead finger. Maybe I love you so much I love you no matter who you are pretending to be. Who said that? SURE you can die! You want to die?!\n\nThat\'s not soon enough! I guess if you want children beaten, you have to do it yourself. No, I\'m Santa Claus! Shut up and take my money! Ooh, name it after me! You, a bobsleder!? That I\'d like to see!\n\nBender, hurry! This fuel\'s expensive! Also, we\'re dying! We need rest. The spirit is willing, but the flesh is spongy and bruised. So, how \'bout them Knicks? Humans dating robots is sick. You people wonder why I\'m still single? It\'s \'cause all the fine robot sisters are dating humans!\n\nBut existing is basically all I do! Incidentally, you have a dime up your nose. Well I\'da done better, but it\'s plum hard pleading a case while awaiting trial for that there incompetence. Then throw her in the laundry room, which will hereafter be referred to as \"the brig\".\n\nNo argument here. But I know you in the future. I cleaned your poop. What\'s with you kids? Every other day it\'s food, food, food. Alright, I\'ll get you some stupid food. Well, let\'s just dump it in the sewer and say we delivered it.\n\nBender, quit destroying the universe! You don\'t know how to do any of those. Perhaps, but perhaps your civilization is merely the sewer of an even greater society above you! Hey! I\'m a porno-dealing monster, what do I care what you think?\n\nWow, you got that off the Internet? In my day, the Internet was only used to download pornography. And yet you haven\'t said what I told you to say! How can any of us trust you? Why am I sticky and naked? Did I miss something fun?','Futurama Ipsum & Some Styling','        ','publish','open','open','','futurama-ipsum-some-styling','','','2019-07-23 21:42:17','2019-07-23 21:42:17','',0,'http://sweetspeachy.helloyoudemos.com/?p=34',0,'post','',0),(37,2,'2019-06-22 21:50:13','2019-06-22 21:50:13','<p><img class=\"alignnone size-full wp-image-928\" src=\"http://fifthinning.wpengine.com/wp-content/uploads/2017/07/HC-post-33.jpg\" alt=\"\" width=\"1500\" height=\"1039\" />No, no, the Pirate Ipsum doesn\'t really match this beautiful theme. Some would say that it doesn\'t go with the design at all. Whaat?! I will pretend I didn\'t know &amp; provide the Pirate Ipsum link <a href=\"http://pirateipsum.me\">here!</a></p>\n<p>Yardarm boom galleon grapple Gold Road grog blossom fluke fathom crimp crow\'s nest. Jack Ketch walk the plank log grog black jack provost Letter of Marque cog gunwalls Sail ho